import React from 'react'
import Form  from 'react-bootstrap/Form';

export default function PaymentScreen() {
  return (
    <Container>
    <h1 className='mb-3'>Sign in</h1>
     <Form>
        <Form.Check
            label="Paypal"
            name="group1"
            type='radio'
            id={`inline-1`}
          />
          
          <Form.Check
            label="Stripe"
            name="group1"
            type='radio'
            id={`inline-2`}
          />
          
     </Form>
     </Container>
  )
}
